import React from "react";

const BikeList = () => {

    // TODO: implement fetching
    let bikes = [
        {
            name: "Lastenrad 1"
        },
        {
            name: "Lastenrad 2"
        },
    ]

    return (
        <>
            <h1>Bike list</h1>

            {bikes.map((bike) => (

                <li key={index} className="bike-list">
                    <div className="bike-list-item">
                        <p>{bike.name}</p>
                    </div>
                </li>
            ))
            }
        </>
    );
};

export default BikeList;
